import React, { useState } from "react";

const Todolist=()=>{

    const [items,fitems]=useState("");

    const inputlist=(event)=>{
        fitems(event.target.value);
    }

    return(
        <>
            <h1>ToDo List{items}</h1>
            <input 
                type="Text"
                placeholder="Add Items Name Here"
                onChange={inputlist}
            />
            <button>+</button>
            {/* {items.map=(value)=>{

            }} */}
        </>
    )
}
export default Todolist;
